import React from 'react';

class Detail extends React.Component{
    componentDidMount(){
        const{location, history} = this.props;
        console.log(location);
        if(location === undefined){
            history.push("/");
        }
    }

    render(){
        return <div>Hi</div>;
    }
}

export default Detail;
